            ts.data('dInfo', ts.attr('dInfo'));
            ts.bind('click', function (event) {
                event.preventDefault();
                event.stopPropagation();
                //
                if (ts.hasClass('click_on')) {
                    ts.removeClass('click_on');
                    ti.css('display', 'none');
                } else {
                    ts.addClass('click_on');
                    ti.css('display', '');
                }
            });
